import React from 'react'
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
        <h2>Breweries list</h2>
        <p>Go to <Link to='/breweries'>Breweries</Link>></p>
    </div>
  )
}

export default Home
